public class StringDemo {

    public static void main(String[] args) {
        String str = "";
        for (int i = 0; i < 65533; i++) {
            str += "a";
        }
        System.out.println(str.length());
        str += "a";
        System.out.println(str.length());
        System.out.println(str);

        // 编译期
        // Error：常量字符串过长
        // Java中，所有需要保存在常量池中的数据，长度最大不能超过65535；
//        String b = "";
//        System.out.println(b.length());
    }
}
